import React from 'react';
import logo from './logo.svg';
import './Card.css';

function Card(props: any) {
    return (

        <div className="card">
            <div className="title">Ciudad: <p>{props.ciudad}</p></div>
            <div className="title">Estado: <p>{props.estado}</p></div>
            <div className="title">Pais: <p>{props.pais}</p></div>        
            <div className="title">Temperatura: <p>{props.temperatura}</p></div>
            <div className="title">Humedad: <p>{props.humedad}</p></div>
            <div className="title">Velocidad de viento: <p>{props.windSpeed}</p></div>     
        </div>
        
    );
}

export default Card;
